import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Title from '../Title/Title';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

function preventDefault(event) {
  event.preventDefault();
}

const useStyles = makeStyles({
  depositContext: {
    flex: 1,
  },
});

export default function SubmitGuess(props) {
  const classes = useStyles();
  console.log(props.nextGuessInfo.nextGuessSubmitted);

  let form = <form className={classes.form} noValidate>
                <TextField
                variant="outlined"
                margin="normal"
                required
                fullWidth
                id="numbers"
                label="Case Numbers"
                name="caseNumbers"
                autoFocus
                />
                <Button
                    type="submit"
                    fullWidth
                    variant="contained"
                    color="primary"
                    className={classes.submit}>
                    Submit
                </Button>
            </form>;

  return (
    <React.Fragment>
        {props.nextGuessInfo.nextGuessSubmitted ?<Title>Latest Guess</Title>  : <Title>Submit Next Guess</Title>}
      <Typography color="textSecondary" className={classes.depositContext}>
        {new Date(props.nextGuessInfo.nextGuessDate).toDateString()}
      </Typography>
      {form}
    </React.Fragment>
  );
}
